INSERT INTO `gygy_played` VALUES ('186', '前四单式', '1', '5', '20000.00', '17000.00', '4', '58', '手动输入一个4位数号码组成一注。', '手动输入一个4位数号码组成一注，所选号码与开奖号码的万位、千位、百位、十位相同，且顺序一致，即为中奖。', '如：输入12345678，则你投两注分别为1234和5678，如果开奖号为1234*，则您中奖一注。', 'dxwfQ4d', 'ds', 'ds', 'ssc_dx_q4d', '0', '5', '10000');
